import Iframe from 'react-iframe'
import { useNavigate } from 'react-router-dom';

// import './Planner.css'

const Planner = () => {
  const navigate = useNavigate();
    return (

      <div>
        <Iframe url="https://planner5d.com/v?key=79e530c1a779b82338bbd76fe5467b5e&viewMode=3d"/>
        <button className='button' onClick={() => {navigate('/HousingEdit');}}> กลับ </button>
    </div>

    );
  }
  export default Planner;
